import React from "react";
import { View, Text, Image, StyleSheet, ScrollView } from "react-native";
import NavigationBar from "./NavigationBar";

const yourNewImage = require("./assets/images/background_contactos.jpg");
const contactInfoBackground1 = require("./assets/images/osteopatia.jpg");
const contactInfoBackground2 = require("./assets/images/background_contactos.jpg");
const contactInfoBackground3 = require("./assets/images/background_contactos.jpg");
const contactInfoBackground4 = require("./assets/images/background_contactos.jpg");

const PreçosScreen = () => {
  return (
    <View style={styles.container}>
      <NavigationBar title="Formulário" />

      <Image source={yourNewImage} style={styles.topImage} />
      <View style={styles.contentBelowImage}>
        <ScrollView contentContainerStyle={styles.formContainer}>
          {/* Your form content here */}
        </ScrollView>
        <View style={styles.contactInfoContainer}>
          <View style={styles.contactInfoRow}>
            {renderContactInfo("1", "Osteopatia", "A partir de 50 euros por sessão!\nClique para saber mais informações", contactInfoBackground1)}
            {renderContactInfo("2", "Treino Livre", "A partir de 40 euros por mês!\nClique para saber mais informações", contactInfoBackground2)}
          </View>
          <View style={styles.contactInfoRow}>
            {renderContactInfo("3", "Treino Personalizado", "A partir de 120 euros por mês!\nClique para saber mais informações", contactInfoBackground3)}
            {renderContactInfo("4", "Plano de Nutrição", "A partir de 40 euros por sessão!\nClique para saber mais informações", contactInfoBackground4)}
          </View>
        </View>
      </View>
    </View>
  );
};

const renderContactInfo = (contactNumber, title, content, background) => {
  return (
    <View style={styles.contactInfo}>
      <Image source={background} style={styles.contactImage} />
      <Text style={styles.contactTitle}>{title}</Text>
      <Text>{content}</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "white",
  },
  topImage: {
    width: "100%",
    height: 200,
  },
  contentBelowImage: {
    flex: 1,
    marginTop: 10,
  },
  formContainer: {
    paddingHorizontal: "5%",
    marginTop: 10,
  },
  contactInfoContainer: {
    flexDirection: "column",
    paddingHorizontal: "3%",
    justifyContent: "center",
    flex: 15,
  },
  contactInfoRow: {
    flexDirection: "row",
    justifyContent: "space-evenly",
  },
  contactInfo: {
    borderRadius: 16,
    padding: 20,
    height: 300, // Adjust the height as needed
    width: "45%", // Adjust the width for two boxes in a row
    margin: 20,
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
  },
  contactImage: {
    width: "100%", // Set image width to 100% of the container
    height: 130, // Adjust image height as needed
  },
  contactTitle: {
    fontSize: "15px",
    fontWeight: "bold",
    marginBottom: 20,
    color: "blue",
  },
});

export default PreçosScreen;
